import React from 'react';
import { NavLink } from 'react-router-dom';
import { FaDropbox, FaUser, FaProjectDiagram, FaFileAlt, FaEnvelope } from 'react-icons/fa';
import portfolio from '../assets/portfolio.png';

const Sidebar = () => (
  <aside className="sidebar">
    <div className="sidebar-logo" style={{ color: "#ffffff", width: "300px", height: "150px" }}>
         <img src={portfolio} alt="icon" style={{ width: '48px', height: '48px' }} />
    <br></br>
    My Portfolio
    </div>
    <nav>
      <NavLink to="/" end><FaDropbox /> Home</NavLink>
      <NavLink to="/about"><FaUser /> About</NavLink>
      <NavLink to="/projects"><FaProjectDiagram /> Projects</NavLink>
      <NavLink to="/resume"><FaFileAlt /> Resume</NavLink>
      <NavLink to="/contact"><FaEnvelope /> Contact</NavLink>
    </nav>
  </aside>
);

export default Sidebar;
